desc:
Sprzedam uchwyty do szafek. Kolor srebrny matowy.

4 sztuki długość 38 cm, rozstaw 32 cm; 
10 sztuk długość 29 cm, rozstaw 22,5 cm; 
6 sztuk długość 19,5 cm, rozstaw 12,5 cm; 
2 sztuki długość 16,5 cm, rozstaw 9,5 cm; 
1 sztuka długość 22,5 cm, rozstaw 16 cm

Uwolnij w sobie artystę i stwórz najpiękniejsze

dzieła za pomocą farby akrylowej.

Zestaw Farb Akrylowych + 6 szt.

16 tubek o pojemności 36 ml/ sztuka
 szeroka kolorystyka;
bardzo dobre krycie;
odpowiednia do wszystkich rodzajów podłoży;
w plastikowych, zakręcanych tubkach, które umożliwiają wielokrotne użytkowanie oraz zapobiegają wysychaniu;
każdy pędzelek 6 szt.: z innym kształtem włosia;
Kompletny zestaw z różnymi rozmiarami pędzelków;
przeznaczenie: farby akrylowe, olejowe i wodne
z certyfikatem FSC® - drewno pozyskiwane w sposób zrównoważony
można używać do :
decoupage'u
szkolnych prac i rysunków
zdobjenie różnych powierzchni tj. szkło, ceramika, drewno
domowych prac plastycznych
